  "privacy_modal_subtitle": "Nuestros Principios de Privacidad y Seguridad",
  "privacy_content": "<h1><b>Aviso de Privacidad</b></h1> <p>Este aviso de privacidad es aplicable al uso del producto de Información de Producto Electrónico de la Asociación PharmaLedger. </p> <h2>Contactos</h2><ul class=\"list-space\" role=\"list\"><li role=\"listitem\"><b>a) Identidad y contactos del responsable o responsables conjuntos</b></p><p>El responsable de sus datos es la Asociación PharmaLedger.</p></li><li role=\"listitem\"><b>b) Contactos del oficial de protección de datos</b><p>La Oficina de Protección de Datos de la Asociación PharmaLedger está disponible en dpo@pharmaledger.org.</p></li></ul><h2>Qué datos personales utilizamos</h2><p>Recopilamos únicamente los datos técnicos necesarios para entregar su folleto electrónico. Esto incluye su dirección IP e identificadores técnicos del dispositivo y navegador que utiliza para acceder a nuestra aplicación.</p> <p><em>En detalle, recopilamos los siguientes elementos de datos:</em></p><ul><li><p><em>Acceso desde dispositivo móvil.</em> Podemos solicitar acceso o permiso a ciertas funciones de tu dispositivo móvil, incluyendo la cámara de tu dispositivo móvil y otras características. Si deseas cambiar nuestro acceso o permisos, puedes hacerlo en la configuración de tu dispositivo.</p></li><li><p><em>Información del dispositivo móvil.</em> Recopilamos automáticamente información del dispositivo (como el ID de tu dispositivo móvil, modelo y fabricante), información sobre el sistema operativo, información de versión y configuración del sistema, números de identificación del dispositivo y la aplicación, tipo y versión del navegador, modelo de hardware, proveedor de servicios de Internet y/o operador móvil, y dirección de Protocolo de Internet (IP) (o servidor proxy). Si estás utilizando nuestra(s) aplicación(es), también podemos recopilar información sobre la red telefónica asociada con tu dispositivo móvil, el sistema operativo o plataforma de tu dispositivo móvil, el tipo de dispositivo móvil que utilizas, el ID único de tu dispositivo móvil y la información sobre las características de nuestra(s) aplicación(es) a las que accediste.</p></li></ul><h2>Por qué recopilamos tus datos personales</h2><h3>Propósitos</h3><p>Recopilamos tus datos técnicos con el propósito de proporcionarte un folleto electrónico de producto para tu medicamento. </p><p>Por lo tanto, podemos basarnos en las siguientes bases legales para procesar tu información personal:</p><ul><li><p><b>Cumplimiento de un contrato.</b> Podemos procesar tu información personal cuando creemos que es necesario para cumplir con las obligaciones contractuales hacia ti, incluyendo la prestación de nuestros servicios o a tu solicitud antes de celebrar un contrato contigo.</p></li><li><p><b>Obligaciones legales.</b> Podemos procesar tu información cuando consideramos que es necesario para cumplir con nuestras obligaciones legales, como cumplir con nuestras obligaciones bajo regulaciones de atención médica y legislación de salud pública.</p></li></ul><h2>Con quiénes compartimos tus datos personales</h2><p>Empresas miembro y proveedores de servicios de terceros.</p><p>Compartimos tus datos con proveedores de terceros, prestadores de servicios, contratistas o agentes ('terceros') que realizan servicios para nosotros o en nuestro nombre y requieren acceso a dicha información para llevar a cabo su trabajo. Tenemos contratos establecidos con nuestros terceros, diseñados para ayudar a proteger tu información personal. Esto significa que no pueden hacer nada con tu información personal a menos que les hayamos indicado que lo hagan. Tampoco compartirán tu información personal con ninguna organización aparte de nosotros. También se comprometen a proteger los datos que tienen en nuestro nombre y a conservarlos durante el período que les instruimos. Las categorías de terceros con los que podemos compartir información personal son las siguientes:</p><ul><li><p>Fabricantes de medicamentos (Empresas miembro)</p></li><li><p>Proveedores de servicios técnicos</p></li></ul><h2>Cuánto tiempo almacenamos tus datos personales</h2><p>La Asociación PharmaLedger solo almacena tus datos técnicos durante el tiempo necesario para procesar tu solicitud de folleto, hasta un máximo de 30 días. </p><p>El fabricante de tu medicamento también almacenará tus datos durante un período definido según sus políticas de retención de datos. Para obtener más información sobre esta retención, por favor, ponte en contacto con el fabricante de tu medicamento.</p><h2>Si no nos proporcionas tus datos personales</h2><p>Si eliges no proporcionarnos tus datos técnicos, no podremos cumplir con tu solicitud de folleto.</p><h2>Tus derechos</h2><p>Si tienes alguna solicitud relacionada con tus datos personales bajo el RGPD, como una solicitud de acceso o eliminación de tus datos, puedes ponerte en contacto con nosotros en dpo@pharmaledger.org.</p><p>Procesaremos dichas solicitudes en un plazo de 30 días.</p><h2>Revocación del consentimiento</h2><p>Si tienes alguna solicitud relacionada con tus datos personales bajo el RGPD, como una solicitud de acceso o eliminación de tus datos, puedes ponerte en contacto con nosotros en dpo@pharmaledger.org.</p><p>Procesaremos dichas solicitudes en un plazo de 30 días.</p><h2>Proceso de toma de decisiones automatizado</h2><p>No utilizamos ningún proceso de toma de decisiones automatizado en la prestación de este servicio a ti.</p><h2>Transferencia Internacional de Datos Personales</h2><p>Cuando el fabricante de tu medicamento requiere que transfiramos tus datos fuera de la Unión Europea, utilizamos Cláusulas Contractuales Estándar para proteger tus datos.</p><h2>Cómo Presentar una Queja</h2><p>Si tienes alguna solicitud relacionada con tus datos personales bajo el RGPD, como una solicitud de acceso o eliminación de tus datos, puedes ponerte en contacto con nosotros en dpo@pharmaledger.org.</p><p>Procesaremos dichas solicitudes en un plazo de 30 días. Además, puedes ponerte en contacto con tu autoridad supervisora local si sientes que tus derechos no están siendo respetados.</p>",
