  "terms_content": "<h2>Términos y Condiciones para el Sitio Web y la Aplicación de Información Electrónica de Productos de la Asociación PharmaLedger </h2><p>Al ingresar o utilizar el sitio web y la aplicación de Información Electrónica de Productos de la Asociación PharmaLedger (los 'Servicios'), aceptas quedar sujeto a estos términos y condiciones (los 'Términos'). No podrás tener acceso ni utilizar los Servicios si no estás de acuerdo con estos Términos. Los Servicios son operados por la Asociación PharmaLedger (la 'Asociación') y están destinados a ser utilizados por individuos que buscan información sobre sus medicamentos. Los Servicios son entregados a través de una red multiparte, y el fabricante de tu medicamento proporciona la información del producto que se muestra a través de los Servicios. La Asociación actúa como el controlador de datos para esta información. </p><h2>Uso de los Servicios </h2><p>Aceptas utilizar los Servicios solo con fines legales y de una manera que no infrinja los derechos de terceros ni restrinja o inhiba el uso y disfrute de los Servicios por parte de cualquier tercero. Esta restricción o inhibición incluye, sin limitación, conductas que sean ilegales o que puedan acosar, causar molestias o inconvenientes a cualquier persona, así como la transmisión de contenido obsceno u ofensivo o la interrupción del flujo normal de diálogo dentro de los Servicios. </p><h2>Propiedad Intelectual </h2><p>El contenido de los Servicios, incluyendo, pero no limitándose a, texto, gráficos, imágenes y software, es propiedad de la Asociación o de sus licenciantes y empresas miembro y está protegido por leyes de derechos de autor y otras leyes de propiedad intelectual. No puedes utilizar ningún contenido de los Servicios con fines comerciales sin el consentimiento expreso por escrito de la Asociación. </p><h2>Responsabilidad</h2><p>La Asociación no realiza representaciones ni garantías de ningún tipo, ya sean expresas o implícitas, sobre el funcionamiento de los Servicios o la información, contenido, materiales o productos incluidos en los Servicios. La Asociación no será responsable de ningún tipo de daños que surjan del uso de los Servicios, incluyendo, pero sin limitarse a, daños directos, indirectos, incidentales, punitivos y consecuentes. </p><h2>Ley Aplicable </h2><p>Estos Términos y tu uso de los Servicios estarán regidos y se interpretarán de acuerdo con las leyes de Suiza, y cualquier disputa se resolverá en los tribunales de Basilea, Suiza. </p><h2>Cambios en los Términos </h2><p>La Asociación se reserva el derecho de cambiar estos Términos en cualquier momento, y eres responsable de revisar estos Términos periódicamente en busca de cambios. Tu continuo uso de los Servicios después de que se hayan realizado cambios en los Términos constituirá tu aceptación de los Términos revisados.</p>",
  "about_modal_subtitle": "Sobre",
  "about_modal_title": "PharmaLedger",
  "about_content": "<h2>Sobre esta aplicación</h2><p>Esta aplicación le es proporcionada por PharmaLedger®. Fue desarrollada conjuntamente por organizaciones de representación de pacientes, compañías farmacéuticas y expertos en tecnología.</p><p>Permite a los usuarios de la aplicación ver información sobre su medicamento escaneando el código de barras en el paquete del producto.</p><p>La información mostrada es proporcionada por el titular de la Autorización de Comercialización del producto.</p><h2>Sobre PharmaLedger</h2><p>PharmaLedger® es la marca de PharmaLedger Association (PLA).</p><p>PLA es una asociación global sin fines de lucro y neutral. El propósito de la Asociación es crear y promover un ecosistema digital de confianza en la atención sanitaria.<p>La Asociación fomenta la cooperación en los sectores de la salud y ciencias de la vida y promueve innovaciones y su implementación para el beneficio mutuo de los pacientes y otras partes interesadas.",
  "help_modal_title": "Ayuda",
  "help_modal_subtitle": "Preguntas frecuentes",
  "help_content": "<div><p><b><h2>¿Qué es IEP?</h2></b></p><p> <b>IEP</b> es una abreviatura de <b> Información electrónica del producto.</b> Este una versión electrónica del folleto de Información del Producto en papel que normalmente se encuentra dentro del paquete de un producto farmacéutico. En algunos casos, el <b>IEP</b> puede haber reemplazado el folleto en papel.</p><p><b><h2>¿Qué es PharmaLedger?</h2></b></p><p>La Asociación PharmaLedger (PLA) es una asociación sin fines de lucro con sede en Suiza con el propósito de habilitar y fomentar un Ecosistema de Confianza Digital en el campo de la atención médica a través de una plataforma de código abierto estandarizada y confiable. PLA promueve la colaboración y acelera la innovación y la adopción para lograr beneficios mutuos en los ámbitos de la atención médica y las ciencias de la vida, tanto para los pacientes como para otras partes interesadas. PLA se formó en 2022 para dar continuidad al trabajo del proyecto PharmaLedger, un proyecto de 3 años financiado por la Comisión Europea y la industria farmacéutica con el objetivo de demostrar el valor de las soluciones basadas en blockchain. Para obtener más información, visite el siguiente enlace: https://pharmaledger.org.</p><p><b><h2>¿Qué es el DataMatrix?</h2></b></p><p>Es un tipo de código de barras que se encuentra en el paquete de su producto. Es un código de barras cuadrado en blanco y negro y se verá similar a esto:<br><img src=\"./images/barcode_example.png\" alt='DataMatrix barcode example'></p><p><b><h2>¿Cómo usar la aplicación?</h2></b></p><p>Siga las instrucciones en la página de inicio de <b>la aplicación</b>… muestra una imagen que indica dónde encontrar el <b>DataMatrix</b> en el paquete de su producto. Una vez que haya localizado el <b>DataMatrix</b>, haga clic en el botón Escanear <b>DataMatrix</b>. Permita que la aplicación utilice la cámara para escanear el <b>DataMatrix</b>. Utilice la cámara para enfocar el <b>DataMatrix</b>. Una vez que el paquete se haya escaneado con éxito, se mostrará el <b>IEP</b>. Puede hacer clic en el botón \"+\" para obtener más detalles. </p><p><b><h2>¿Por qué mi escaneo del DataMatrix no arroja resultados?</h2></b></p><p>Existen varias razones por las cuales el <b>DataMatrix</b> en el paquete puede no proporcionar un IEP. Una de las razones podría ser el enfoque de la cámara. Por favor, intente escanear el código en un lugar bien iluminado y asegúrese de que el código sea claramente visible en la pantalla. Si le resulta difícil mantener la mano estable, podría intentar utilizar una mesa para apoyar sus manos.</p></div>",
